Новые заявления Дмитрия Пескова:

🗣 Путину доложили о результатах российско-украинских переговоров, но пока рано давать оценки;

🗣 Россия продолжает считать Зеленского президентом. Разговора Путина с Зеленским пока в планах нет;

🗣 Потенциальное вступление Киева в Евросоюз — это не военно-политический блок, поэтому эта тема не лежит в русле вопросов стратегической безопасности;

🗣 Манера США вводить санкции «как бацилла» распространилась на ЕС.

Также Песков заявил, что не располагает данными о потерях Вооруженных сил РФ в Украине.

Кроме того, Пескова спросили, будет ли Россия каким-то образом участвовать в украинских выборах в будущем. «Кремль не может участвовать в выборах на Украине. Это другая страна», — ответил Песков

